  <h1 style="text-align: center">404 - Page not found</h1>

  <h3 style="text-align: center" id="search">Redirecting to search...</h3>

  <script>
    window.onload = function() {
      let pathSegments = window.location.pathname.replace(/#/g, '').split('/');
      if (pathSegments.length > 0) {
        let lastSegment = pathSegments.pop();
        while (pathSegments.length && !lastSegment) {
          lastSegment = pathSegments.pop();
        }

        if (!lastSegment)
          return;

        let queryParts = lastSegment.split(/[-_]/);
        
        let query = queryParts.join(' ');
        setTimeout(function() {
          window.location.href = `https://labs.neuralseek.com//search.html?q=${encodeURIComponent(query)}`;
        }, 3000); 
      } 

    }
  </script>
